#include <stdio.h>
#include <assert.h>

void func0(int *a, int *b);

int main(){
    int x = 5, y = 10;
    func0(&x, &y);
    assert(x == 10 && y == 5);

    x = -1, y = 100;
    func0(&x, &y);
    assert(x == 100 && y == -1);

    x = 0, y = 0;
    func0(&x, &y);
    assert(x == 0 && y == 0);

    x = 2147483647, y = -2147483648;
    func0(&x, &y);
    assert(x == -2147483648 && y == 2147483647);

    printf("All test cases passed!\n");
    return 0;
}
